sources.styles/blocks/navbar.scss:
.header__navbar {
  display: none;

  @include onDesktop {
    background-color: $pinkcolor;
    display: flex;
    justify-content: space-between;
    padding: 32px 36px 0;

    transform: translateX(-100%);
    transform: translateX(0);
    transition: transform 0.3s;
  }

  &-list {
    display: flex;

    &--link {
      text-decoration: none;
      color: $darkcolor;

      &:last-child {
        padding-left: 7px;
      }

      &:hover {
        text-transform: uppercase;
        color: $orangecolor;
      }
    }

  }

}

sources.styles/utils/_mixins.scss:
@mixin onTablet {
  @media (min-width: 744px) {
    @content;
  }
}

@mixin onDesktop {
  @media (min-width: 1200px) {
    @content;
  }
}

@mixin topNav {
    padding: 20px 4px;
    display: flex;
    justify-content: space-between;
    background-color: $pinkcolor;
}

@mixin titleText {
  color: $orangecolor;
      text-transform: uppercase;
      font-weight: 400;
      font-size: 46px;
      line-height: 100%;
      letter-spacing: 5%;
      margin-top: 24px;
}

@mixin subText {
  color: $darkcolor;
  font-style: normal;
  font-weight: 400;
  font-size: 16px;
  line-height: 150%;
  letter-spacing: -1%;
}

sources.styles/blocks/header.scss:
.header {

  box-sizing: border-box;
  max-height: 100vh;

  padding: 0 0 32px;
  color: $darkcolor;

  @include onTablet {
    padding: 0 36px 80px;
  }

  &__top {
    @include topNav;

    @include onDesktop {
      display: none;
    }
  }

  &__description {
    display: block;
    font-weight: 400;
    font-style: 16px;
    line-height: 24px;
    padding-top: 32px;

    @include onTablet {
      padding: 80px 44px 0;
    }
  }

  &__content {
    box-sizing: border-box;

    @include onTablet {
      position: relative;
      display: flex;
      flex-direction: column;
      text-align: center;
      justify-content: center;
      margin: 0 auto 0;

      @include onDesktop {
        margin: 0 44px;
      }
    }

    &-title {
      color: $orangecolor;
      font-weight: 400;
      font-size: 60px;
      line-height: 54px;
      letter-spacing: -5%;
      text-align: center;
      text-transform: uppercase;
      margin: 32px 0 0;

      @include onTablet {
        position: absolute;
        top: calc(50% - 116px);
        font-size: 80px;
        line-height: 68px;
        margin: 0;
      }

      @include onDesktop {
        font-size: 116px;
        line-height: 96px;
        margin: 0;
      }

    }

    &-img {

      @include onTablet {
        width: 326px;
        height: 328px;
        margin: 0 auto;
        z-index: -1;
      }
    }

    &__button {
      display: flex;
      align-items: center;

      @include onTablet {
        margin-top: 80px;
      }

      &-button {
        border: 1px solid $orangecolor;
        background-color: $pinkcolor;
        border-radius: 50px;
        width: 288px;
        text-transform: uppercase;
        color: $orangecolor;
        padding: 20px;

        @include onTablet {
          margin: 0 auto;
        }

        &:hover {
          background-color: $orangecolor;
          color: #fff;
        }

        &:focus {
          border: 1px solid #b2341a;
          background-color: #b2341a;
          color: #fff;
        }

        &:disabled {
          opacity: 80%;
        }
      }

      &--description {
        display: inline;
      }
    }
  }
}

sources.styles/blocks/menu.scss:
.menu {

  &__content {
    box-sizing: border-box;
    height: 100vh;
    background-color: $pinkcolor;
  }

  &__top {
    @include topNav;
  }

  &__list {
    display: flex;
    flex-direction: column;
    text-align: center;

    &--item {
      padding: 0;
      text-decoration: none;
      color: $darkcolor;

      &:last-child {
        padding-left: 7px;
      }

      &:hover {
        color: $orangecolor;
        text-transform: uppercase;
      }
    }

    &--link {
      font-weight: 400;
      font-size: 16;
      line-height: 24;
      letter-spacing: -1%;
      margin-bottom: 24px;

      &:last-child {
        margin-top: 32px;
        margin-bottom: 0;
        padding-left: 7px;
      }
    }
  }
}

sources.styles/blocks/grid.scss:
.grid {
  display: grid;
  grid-template-rows: 50px, 50px;
  gap: 30px;

  &__item {
    @for $startrow from 1 through 2 {
      @for $endrow from $startrow through 3 {
        &--#{$startrow}-#{$endrow} {
          grid-row: #{$startrow} / #{$endrow + 1};
        }
      }
    }
  }
}

.content__grid {

  @include onTablet {
    display: grid;
    grid-template-columns: repeat(8, 1fr);
    gap: 24px;
    justify-content: center;
  }

  &__item {
    @for $startcol from 1 through 8 {
      @for $endcol from $startcol through 8 {
        &--#{$startcol}-#{$endcol} {
          grid-column: #{$startcol} / #{$endcol + 1};
        }
      }
    }
  }
}

sources.styles/blocks/products.scss:
.products {
  box-sizing: border-box;

  @include onTablet {
    margin: 24px;
  }

  @include onDesktop {
    margin: 44px;
  }

  &__content {
    box-sizing: border-box;
    display: flex;
    flex-direction: column;
  }


  &__image {
    width: 288px;
    margin: 56px 0 16px;

    @include onTablet {
      width: 328px;
      object-fit: cover;
    }

    @include onDesktop {
      width: 500px;
    }
  }

  &__name {
    text-transform: uppercase;
    color: #7f8096;
    font-size: 16px;
    line-height: 16%;
    margin-bottom: 16px;

  }

  &__image-description {
    @include subText;
    margin-bottom: 24px;
  }

  &__link {
    text-transform: uppercase;
    text-decoration: none;
    color: $orangecolor;
    font-weight: 500;
    font-size: 16px;
    line-height: 16px;
  }
}

sources.styles/blocks/aboutus.scss:
.aboutus {
  box-sizing: border-box;
  padding-bottom: 104px;

  @include onTablet {
    margin: 152px 24px 0;
  }

  @include onDesktop {
    margin: 340px 44px 0;
  }

  &__number-container {
    background-image: url(../images/crumbs.png);

    @include onDesktop {
      display: flex;
      gap: 100px;
    }
  }

  &__content {
    margin-top: 80px;
  }

  &__flex {
    @include onDesktop {
      display: flex;
      gap: 150px;
    }
  }

  &__title {
    @include titleText;
    margin: 36px 0 0;
    font-size: 96px;

  }

  &__subtitle {
    @include subText;
    margin: 8px 0 0;
  }

}

sources.styles/blocks/footer.scss:
.footer {
  box-sizing: border-box;
  padding: 60px 20px;
  background-color: #1C1A26;

  @include onTablet {
    padding: 60px 50px;
  }

  @include onDesktop {
    padding: 60px 130px;
  }

  &__menu {

    &__name {
      text-transform: uppercase;
      font-weight: 500;
      font-size: 16px;
      line-height: 16px;
      letter-spacing: 2%;
      color: #7F8096;
      padding-top: 44px;
    }

    &__list {


      &--item {
        padding: 0;
      }

      &--link {
        text-decoration: none;
        color: #fff;
        font-size: 16px;
        line-height: 24px;
      }
    }
  }

  &__contacts {

    &__title {
      text-transform: uppercase;
      color: #fff;
      font-size: 48px;
      line-height: 40px;
      padding-top: 64px;
      font-weight: 400;

      @include onTablet {
        padding-top: 0;
        margin: 0;
      }

    }

    &__name {
      text-transform: uppercase;
      font-weight: 500;
      font-size: 16px;
      line-height: 16px;
      letter-spacing: 2%;
      color: #7F8096;
      padding-top: 40px;
    }

    &__contacts {
      color: #fff;
      text-decoration: none;
      font-size: 16px;
      line-height: 24px;

      &-number {
        display: flex;
        flex-direction: column;
        gap: 16px;
      }
    }

    &-social {
      margin-top: 42px;

      &--logo {
        margin-right: 40px;
        width: 20px;
        height: 20px;
      }

      &--rights {
        color: #7F8096;
        font-weight: 400;
        font-size: 16px;
        line-height: 24px;
        margin-top: 42px;
      }
    }
  }

}

sources.styles/main.scss:
@import "utils";
@import "./blocks/navbar.scss";
@import "./blocks/header.scss";
@import "./blocks/menu.scss";
@import "./blocks/grid.scss";
@import "./blocks/products.scss";
@import "./blocks/aboutus.scss";
@import "./blocks/footer.scss";

.page {

  &__body {
    margin: 0;
    background-color: $pinkcolor;
    font-family: "Inter", sans-serif;
    scroll-behavior: smooth;
  }

  &__menu {
    position: fixed;
    top: 0;
    right: 0;
    left: 0;

    transform: translateX(-100%);
    transition: transform 0.3s;

    &:target {
      transform: translateX(0);
    }
  }

  &__section {
    margin-top: 160px;

    &-title {
      @include titleText;

      @include onTablet {
        font-size: 56px;
      }

      @include onDesktop {
        font-size: 72px;
      }
    }

    &-subtitle {
      @include subText;
    }
  }

}

.container {
  max-width: 1260px;
  padding: 0 16px;
}
